import React, { useState } from 'react';
import styled from 'styled-components';

import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';

import 'bootstrap/dist/css/bootstrap.min.css';

const List = (props) => {
  const teammate = [
    {
      id: 1,
      teammateList: [
        'Lulu',
        'Sylas',
        'Hecarim',
        'Ornn',
        'Bard',
        'Zoe',
        'Aurelion Sol',
      ],
    },
    {
      id: 2,
      teammateList: [
        'Ezreal',
        'Skarner',
        'Shen',
        'Twitch',
        'Varus',
        'Illaoi',
        'Ornn',
        'Xayah',
      ],
    },
    {
      id: 3,
      teammateList: [
        'Braum',
        'Lillia',
        'Shen',
        'Diana',
        'Olaf',
        'Sylas',
        'Ornn',
        'Pyke',
      ],
    },
    {
      id: 4,
      teammateList: [
        'Lulu',
        'Hecarim',
        'Neeko',
        'Ornn',
        'Sona',
        'Bard',
        'Ao Shin',
      ],
    },
    {
      id: 5,
      teammateList: [
        'Qiyana',
        'Shen',
        'Elise',
        'Sylas',
        'Ornn',
        'Syfen',
        'Pyke',
      ],
    },
    {
      id: 6,
      teammateList: [
        'Heimerdinger',
        'Vladimir',
        'Lillia',
        'Nami',
        'Illaoi',
        'Ryze',
        'Sylas',
        'Zoe',
      ],
    },
    {
      id: 7,
      teammateList: [
        'Senna',
        'Sett',
        'Shen',
        'Swain',
        'Hecarim',
        'Xayah',
        'Shyvana',
        'Yasuo',
      ],
    },
    {
      id: 8,
      teammateList: [
        'Sejuani',
        'Shen',
        'Twitch',
        'Hecarim',
        'Xayah',
        'Bard',
        'Shyvana',
      ],
    },
    {
      id: 9,
      teammateList: [
        'Skarner',
        'Varus',
        'Sylas',
        'Illaoi',
        'Lulu',
        'Ornn',
        'Aurelion Sol',
      ],
    },
    {
      id: 10,
      teammateList: [
        'Qiyana',
        'Yone',
        'Shen',
        'Diana',
        'Olaf',
        'Sylas',
        'Ornn',
        'Yasuo',
      ],
    },
  ];
  const [expand, setExpand] = useState('d-none');
  const expandHandler = () => {
    if (expand == 'd-none') {
      setExpand('active');
    } else {
      setExpand('d-none');
    }
  };
  return (
    <Wrapper>
      <TierGroup>
        <div className='team-info'>
          <div className='grade'>{props.data.grade}</div>
          <div className='team'>
            <div className='team-title'>{props.data.teamTitle}</div>
